      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE NOT + + col2 * ( - - 92 ) * + col1 * - col0 * + - col2 NOT BETWEEN + col1 + col0 / + col1 AND - + col1 / 32;
  - name: tab1

outputs:
  - name: q3064.out
    data: |
